import logo from './logo.svg';
import './App.css';
import React, { Component } from "react";
class App extends Component {
  state ={users:[] }

  componentDidMount() {
    fetch('/api/1')
    .then(res => res.json())
    .then(users => this.setState({ users}));
  }
render(){
  return (
    <div className="App">
      <header className="App-header">
       <p>
         {this.state.users.map(user => <li key={user.StopId}>
           {user.Route} {user.hours}
         </li>)}
         </p>

      </header>
    </div>
  );
}
}

export default App;
